import React from "react";
import "./index.css";
import MainTable from "./MainTable";

function App() {
  return (
    <div className="w-screen h-screen bg-gray-100 p-8">
      <h1 className="text-xl font-bold">
        Main Page
      </h1>
      <MainTable />
    </div>
  );
}

export default App;
